                                    </div>
                                    <ul>
                                        <li>Use Pressure Sensitive Tapes such as BOPP.</li>
                                    </ul>
                                    <h6>Locations</h6>

                                    <ul>

                                        <li>Seal the center seam of the top and bottom of the box.
                                        </li>
                                        <li>For heavy shipments, apply H-Taping by sealing both the center and edge
                                            seams on the box.</li>

                                    </ul>

