                        <h2 class="accordion-header" id="headingEight">
                            <button class="accordion-button collapsed" type="button" data-bs-toggle="collapse"
                                data-bs-target="#collapseEight" aria-expanded="false" aria-controls="collapseEight">
                                <h4>Shipment labelling</h4>
                            </button>
                        </h2>
                        <div id="collapseEight" class="accordion-collapse collapse" aria-labelledby="headingEight"
                            data-bs-parent="#accordionExample">
                            <div class="accordion-body">
                                <p>Proper labeling is crucial for faster and safe handling of the shipment in reaching
                                    the intended destination.</p>


                                <div>
                                    <h4 class="my-4">Essential data</h4>


                                    <ul>
                                        <li>Barcode height (min. size : 8 mm)</li>
                                        <li>Waybill number and Barcode (min. size : 8 MIL, 1MIL= 0.2032mm)</li>
                                        <li>Order number and Barcode (min. size : 8 MIL, 1MIL= 0.2032mm)</li>
                                        <li>Consignee address (min. font size: 8pts, Calibri body)</li>
                                        <li>Return address (min. font size: 8pts, Calibri body)</li>
                                        <li>Retail/Tax Invoice</li>
                                    </ul>
                                    <h6>Locations</h6>

                                    <ul>

                                        <li>Seal the center seam of the top and bottom of the box.
                                        </li>
                                        <li>For heavy shipments, apply H-Taping by sealing both the center and edge
                                            seams on the box.</li>

                                    </ul>

                                </div>
