                                    <ul>

                                        <li>Paste the label on a seamless flat face of the box/flyer</li>
                                        <li>Paste the label away from seams or edges of the box</li>
                                        <li>Readability of barcode is important for faster and correct processing of
                                            shipments</li>
                                        <li>In flyers/polybags, all the essential data on labels should be visible and
                                            the label should be placed flat</li>
                                        <li>The pocket containing the label in flyer should be taped at the opening to
                                            avoid the loss of label</li>
                                        <li>Thermal printed labels are strongly recommended over regular labels</li>
                                    </ul>

